import React from "react";
import { Card } from "./card";
export const CardList = ({ books }) => {
  return (
    <div className="grid xs:grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 mx-auto p-2 space-x-5 space-y-10 max-w-6xl">
      <div className="flex flex-row gap-5]">
        {books.map((element, index) => {
          return (
            <div className="flex flex-row w-[450px] h-[450px]" key={index}>
              <Card book={element}></Card>
            </div>
          );
        })}
      </div>
    </div>
  );
};
